import React from 'react';
import styled from 'styled-components';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { Map, MapMarker } from 'react-kakao-maps-sdk';
import useKakaoLoader from '../hook/useKakaoLoader';
import { CopyToClipboard } from 'react-copy-to-clipboard';
// import iconCopy from '../assets/icon-copy.png';

export default function WayToCome() {
  useKakaoLoader();

  const TOAST = {
    position: toast.POSITION.BOTTOM_CENTER,
    autoClose: 1000,
    closeButton: false,
    icon: true,
    hideProgressBar: true,
    progress: undefined,
  };

  const handleCopyClick = (isCopySuccess) => {
    if (isCopySuccess) {
      toast.success('주소가 복사되었습니다!', TOAST);
    } else {
      toast.error('주소 복사에 실패했습니다.', TOAST);
    }
  };

  return (
    <WayToComeWrapper>
      <StyledToastContainer />
      <HeadText>오시는길</HeadText>
      <CopyContainer>
        <MapText>
          서울 강남구 도곡로99길 16 <br /> 6층 트라디노이
        </MapText>
        <CopyToClipboard
          text="서울 강남구 도곡로99길 16"
          onCopy={handleCopyClick}
        >
          <CopyButton>주소 복사하기</CopyButton>
        </CopyToClipboard>
      </CopyContainer>
      <Map // 지도를 표시할 Container
        id="map"
        center={{
          // 지도의 중심좌표
          lat: 37.501854537491795,
          lng: 127.06600921351016,
        }}
        style={{
          // 지도의 크기
          width: '100%',
          height: '300px',
        }}
        level={5} // 지도의 확대 레벨
      >
        <MapMarker
          position={{ lat: 37.501854537491795, lng: 127.06600921351016 }}
        ></MapMarker>
      </Map>
      <LocationContainer>
        <LocationInfo>지하철</LocationInfo>
        <Location>
          2호선 삼성역 3번출구 도보 10분 <br />
          3호선 학여울역 1번출구 도보 10분
        </Location>
        <LocationInfo>버스</LocationInfo>
        <Location>대치 2동 주민센터, 레미안 하이스턴 하차 도보 1분</Location>
        <LocationInfo>주차장</LocationInfo>
        <Location>건물 내 발렛 주차 가능</Location>
      </LocationContainer>
    </WayToComeWrapper>
  );
}

export const WayToComeWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  gap: 3rem;
  margin-top: 4rem;
  padding-bottom: 3rem;
`;

export const HeadText = styled.p`
  font-size: 1rem;
  color: var(--color-main);
  text-align: center;
  letter-spacing: 0.2rem;
`;

export const MapText = styled.p`
  font-size: 1.1rem;
  text-align: center;
  line-height: 2rem;
`;

export const CopyContainer = styled.div`
  position: relative;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin-bottom: 1rem;
`;

export const CopyButton = styled.button`
  cursor: pointer;
  padding: 1rem 1.5rem;
  background-color: #fdf8f1;
  border-radius: 4rem;
  margin-top: 2rem;
  color: #705f53;
  font-size: 0.8rem;
`;

// export const ClipToCopy = styled.button`
//   position: absolute;
//   cursor: pointer;
//   width: 2rem;
//   height: 2rem;
//   background: url(${iconCopy}) no-repeat center;
//   background-color: #f2f2f2;
//   background-size: 70%;
//   border-radius: 50%;
//   border: none;
//   text-align: center;
//   top: 0;
//   right: -2.5rem;
// `;

export const StyledToastContainer = styled(ToastContainer)`
  .Toastify__toast {
    font-size: 1rem;
    border-radius: 0.5rem;
    padding: 1rem 1.5rem;
    color: #fff;
    background: rgba(0, 0, 0, 1);
    bottom: 1rem;
  }
`;

export const LocationContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  gap: 0.8rem;
  font-size: 0.8rem;
`;

export const LocationInfo = styled.p`
  margin-top: 1rem;
  color: #a69284;
`;

export const Location = styled.p`
  margin-top: 0.5rem;
  color: #4d4444;
  line-height: 1.7rem;
`;
